import { createRouter, createWebHistory } from 'vue-router';
import LayoutView from '../views/LayoutView.vue'; // 레이아웃 컴포넌트
import HomeView from '../views/HomeView.vue'; // 홈 컴포넌트
import LoginView from '../views/LoginView.vue'; // 로그인 컴포넌트
import SignupView from '../views/SignupView.vue'; // 회원가입 컴포넌트

const routes = [
  {
    path: '/',
    name: 'Home',
    component: LayoutView, // 기본 레이아웃을 LayoutView로 설정
    children: [
      {
        path: '',
        name: 'HomeView',
        component: HomeView, // LayoutView 안에서 HomeView가 렌더링됨
      },
    ],
  },
  {
    path: '/login',
    name: 'Login',
    component: LoginView,
  },
  {
    path: '/signup',
    name: 'Signup',
    component: SignupView,
  },
  {
    path: '/category',
    name: 'Category',
    component: () => import('../views/CategoryView.vue'),
  },
  {
    path: '/community',
    name: 'Community',
    component: () => import('../views/CommunityView.vue'),
  },
  {
    path: '/guidelines',
    name: 'Guidelines',
    component: () => import('../views/GuidelinesView.vue'),
  },
  {
    path: '/mybooks',
    name: 'MyBooks',
    component: () => import('../views/MyBooksView.vue'),
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
